    const {id} = useParams();
    const {ws, me} = useContext(RoomContext);
    console.log(me)
    useEffect(() => {
        if (me) {
            ws.emit("join-room", {id});
        }
       
    }, [id, me, ws]);
    return <>Romm Id: {id}</>
}
